import { Text, View, StyleSheet} from 'react-native';
import React from 'react';

const ErrorScreen = () => 
{
    return (
        <View style={ styles.emptyList }>
            <Text h4>Oh darn. We don't have that movie.</Text>
            <Text style={ styles.notFoundCaption }>Try searching for another movie</Text>
        </View>
    )
}

export default ErrorScreen

const styles = StyleSheet.create({
    emptyList:{
    flexDirection: 'row',
    marginVertical: 20, 
    width: '50%',
    alignSelf: 'center', 
    color: "white",
    fontSize: 30,
    fontWeight: 'bold',
    elevation: 10,
    borderRadius: 4,
    }
  });
